import React, { Component } from "react";

class DisplayContent extends Component {
  goBack = () => {
    console.log("Back");
    // this.props.history.goBack();
  };
  render() {
    const { title, date, body } = this.props;
    return (
      <React.Fragment>
        <div className="content-container">
          <div className="content-back">
            <img
              src={require("../images/icons/close.svg")}
              alt="Close"
              onClick={this.goBack}
            />
          </div>
          <div className="half-container">
            <img
              src={require("../images/activity.jpg")}
              alt="Activity Sample"
            />
          </div>
          <div className="half-container details">
            <h1>{title}</h1>
            <h2>{date}</h2>
            <p>{body}</p>
            <div className="share-icons">
              <img
                src={require("../images/icons/facebook.svg")}
                alt="Share on Facebook"
              />
              <img
                src={require("../images/icons/twitter.svg")}
                alt="Share on Twitter"
              />
              <img
                src={require("../images/icons/linkedin.svg")}
                alt="Share on LinkedIn"
              />
            </div>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default DisplayContent;
